import React from "react"
import logo from '../logo.svg';

function Header() {
    return (
        <header className="App-header">
            <nav class="nav">
                <a class="nav-link" href="#"><img src={logo} className="App-logo" alt="logo" /></a>
                <a class="nav-link" href="#">Articles</a>
                <a class="nav-link" href="#">Your Health</a>
                <a class="nav-link" href="#">Help</a>
            </nav>
            <p>Enter text here!</p>
        </header>
    )
}

export default Header
